import React, { useEffect, useState } from 'react';
import axios from 'axios';

const App = () => {
  const [siteSettings, setSiteSettings] = useState(null);
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [userRole, setUserRole] = useState('');
  const [isPwdUpdated, setIsPwdUpdated] = useState(false);

  useEffect(() => {
    // Fetch site settings from API
    const fetchSiteSettings = async () => {
      try {
        const response = await axios.get('/api/site-settings/1');
        setSiteSettings(response.data);
      } catch (error) {
        console.error('Error fetching site settings:', error);
      }
    };

    fetchSiteSettings();

    // Check authentication and user role (assuming you have an API to check)
    // Replace these lines with your actual authentication logic
    const checkAuthentication = async () => {
      try {
        const response = await axios.get('/api/check-auth');
        setIsAuthenticated(response.data.isAuthenticated);
        setUserRole(response.data.userRole);
        setIsPwdUpdated(response.data.isPwdUpdated);
      } catch (error) {
        console.error('Error checking authentication:', error);
      }
    };

    checkAuthentication();
  }, []);

  return (
    <div>
      {/* Navbar */}
      <nav className="navbar">
        <div className="navbar-brand">
          <img src="/img/userimg/icon-deal.png" alt="Icon" style={{ width: '30px', height: '30px' }} />
          <h1>{siteSettings?.CompanyName || 'CompanyName'}</h1>
        </div>
        <div className="nav-links">
          {/* Navigation Links */}
          <a href="/">Home</a>
          <a href="/about-us">About Us</a>
          <a href="/landlord">I am Landlord</a>
          <a href="/contact-us">Contact Us</a>
        </div>
        {isAuthenticated && (
          <div className="user-actions">
            {/* Show actions based on user role */}
            {userRole === 'Landlord' && <button>Add Room</button>}
            {(userRole === 'Admin' || userRole === 'Landlord' || userRole === 'User') && <button>My Profile</button>}
          </div>
        )}
        {!isAuthenticated && <button>SignIn</button>}
      </nav>

      {/* Content */}
      {/* Add more content and components here */}

      {/* Footer */}
      <footer className="footer">
        <div>
          <h5>Get In Touch</h5>
          <p><i className="fa fa-map-marker-alt me-3"></i>{siteSettings?.CompanyAddress}</p>
          <p><i className="fa fa-phone-alt me-3"></i>{siteSettings?.CompanyPhone}</p>
          <p><i className="fa fa-envelope me-3"></i>{siteSettings?.CompanyEmail}</p>
        </div>

        <div className="social-links">
          {/* Add social links here */}
        </div>

        <div className="footer-links">
          <h5>Quick Links</h5>
          <a href="/about-us">About Us</a>
          <a href="/contact-us">Contact Us</a>
          {/* Add more links as needed */}
        </div>

        <div className="newsletter">
          <h5>Newsletter</h5>
          <p>If you want to hear about new properties, subscribe to our newsletter.</p>
          <input type="text" placeholder="Your email" />
          <button type="button">Send</button>
        </div>

        <div className="app-links">
          <h5>Get Our App</h5>
          <p>Our mobile app will be ready to download soon.</p>
          <div className="app-icons">
            <img src="/img/userimg/app-store.png" alt="App Store" />
            <img src="/img/userimg/google-play.png" alt="Google Play" />
          </div>
        </div>
      </footer>
    </div>
  );
};

export default App;
